import React from 'react';
import { useSlate } from 'slate-react';

import type { DSlatePlugin } from '@dslate/core';
import {
  getTextProps,
  IconFont,
  toggleTextProps,
  Toolbar,
  useMessage,
} from '@dslate/core';

const TYPE = 'bold';

const Button = () => {
  const editor = useSlate();

  const getMessage = useMessage();

  return (
    <Toolbar.Button
      onClick={() => {
        toggleTextProps(editor, TYPE);
      }}
      active={getTextProps(editor, TYPE)}
      tooltip={getMessage('tooltip', '\u52A0\u7C97')}
    >
      <IconFont type="icon-bold" />
    </Toolbar.Button>
  );
};

const BoldPlugin: DSlatePlugin = {
  type: TYPE,
  nodeType: 'text',
  toolbar: <Button />,
  renderStyle: { fontWeight: 'bold' },
  locale: [
    {
      locale: Locales.zhCN, // \u4E2D\u6587
      tooltip: '\u52A0\u7C97',
    },
    {
      locale: Locales.enUS, //  \u82F1\u6587
      tooltip: '\u52A0\u7C97',
    },
  ],
};

export { BoldPlugin };
